import './navbar.css';
import React from 'react';
import { BrowserRouter as Router, Link } from 'react-router-dom';

import { ShoppingCart } from 'lucide-react';
import logo from '../Assets/logo.png'


const Navbar = () => {

  return (
    <Router>
      <div className='nav'>

      <div className="left">
          <img src ={logo} />
        </div>
        <div className='right'>
        <Link to="/" className='item'>SHOP</Link>
        <Link to="/mens" className='item'>MEN</Link>
        <Link to="/womens" className='item'>WOMEN</Link>
        <Link to="/kids" className='item'>KIDS</Link>
      

        <Link to="/login" className='item'>LOGIN IN</Link>
        <Link to="/cart" className='item'><ShoppingCart/></Link>
        </div>
    
      </div>
    </Router>
  );
};

export default Navbar;
